import React from 'react'
import SignPage from './SignPage'
import {connect} from 'react-redux'
import {loginThunk,getCaptchaUrlThunk} from '../../../redux/AuthReducer'
import {loginTestThunk,userLoad} from '../../../redux/Test/authReducer'
class SignPageContainer extends React.Component{
render(){
    return(
        <SignPage login={this.props.loginTestThunk}  isAuth={this.props.isAuth}  />
    )
}
}

const mapStateToProps=(state)=>({
    isAuth:state.authtest.isAuth,
    //captchaUrl:state.auth.captchaUrl,

})
export default connect(mapStateToProps,{userLoad,loginTestThunk,getCaptchaUrlThunk})(SignPageContainer)
